import React from "react"

function Project(props){
    const img = "../portfolio_assets/FixGradKappa2.png"
    const image = require(img)
    return(
        <div className="container_gray">
            <img src={image} alt="text" className="icon_left"></img>
            <article>
                <h2 className="h2_left">{props.project.caption}</h2>
                <p className="p_left">{props.project.text}</p>
            </article>
        </div>
    )
}

export default Project
